import React, { Component } from 'react';
import './App.css';
import MyName from './MyName';
import Counter from './Counter';

class App extends Component {
  render() {
    return (
      <div>
        <MyName name="리액트" />
        <MyName />
        <Counter />
      </div>
    );
  }
}

export default App;
